import React, { useParams ,useState} from 'react';
import { useNavigate } from 'react-router-dom';

// Define an error state variable
const [error, setError] = React.useState(null);

function TitleSearch() {
  const navigate = useNavigate();
  const { affurl } = useParams();

  // Use try-catch block to handle potential error during redirection
  React.useEffect(() => {
    try {
      navigate(affurl);
    } catch (err) {
      setError(err);
    }
  }, [navigate, affurl]);

  return (
    <div>
      {error ? <p>Error redirecting: {error.message}</p> : <p>Redirecting to: {decodeURIComponent(affurl)}</p>}
    </div>
  );
}

export default TitleSearch;
